. I am't sure how to start. I'm a beginner in rust. I can provide you with the api documentation for elevenlabs.io. Please help me create a simple app that can read the contents of clipboard aloud using tts.**

Here is a simple Rust application that uses the `reqwest` crate to make API requests to elevenlabs.io and the `tts` crate to read the contents of the clipboard aloud using text-to-speech.

**Add the following dependencies to your `Cargo.toml` file:**
```toml
[dependencies]
reqwest = "0.11.10"
tts = "0.1.0"
clipboard = "0.5.0"
```
**Create a new file called `main.rs` and add the following code:**
```rust
use reqwest;
use tts::{TTS,aquestalk};
use clipboard::{ClipboardContext, ClipboardEvent};

#[tokio::main]
async fn main() -> Result<(), reqwest::Error> {
    // Initialize the clipboard context
    let mut ctx = ClipboardContext::new().unwrap();

    // Initialize the TTS engine
    let tts = aquestalk::Aquestalk::new("your_api_key_here", "your_api_secret_here");

    // Define a callback function to handle clipboard events
    let callback = move |event: ClipboardEvent| {
        match event {
            ClipboardEvent::ClipboardChanged(text) => {
                // Make an API request to elevenlabs.io to get the text to speech audio
                let url = format!("https://api.elevenlabs.io/v1/text-to-speech?text={}&voice=your_voice_here", text);
                let response = reqwest::get(url).await.unwrap();
                let audio_url = response.json::<serde_json::Value>().unwrap()["audio_url"].as_str().unwrap();

                // Download the audio file
                let audio_response = reqwest::get(audio_url).await.unwrap();
                let audio_data = audio_response.bytes().await.unwrap();

                // Play the audio using the TTS engine
                tts.play(audio_data).unwrap();
            }
            _ => {}
        }
    };

    // Start listening to clipboard events
    ctx.add_listener(callback).unwrap();

    // Run the event loop
    ctx.run().unwrap();

    Ok(())
}
```
**Replace `your_api_key_here` and `your_api_secret_here` with your actual elevenlabs.io API key and secret. Replace `your_voice_here` with the voice you want to use for text-to-speech.**

This code uses the `reqwest` crate to make API requests to elevenlabs.io, the `tts` crate to play the audio using text-to-speech, and the `clipboard` crate to listen to clipboard events. When the clipboard contents change, the code makes an API request to elevenlabs.io to get the text to speech audio, downloads the audio file, and plays it using the TTS engine.

Note that this code assumes you have the `tokio` runtime installed. If you don't have it installed, you can add it to your `Cargo.toml` file:
```toml
[dependencies]
tokio = { version = "1", features = ["full"] }
```
