  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadDreams = async () => {
      try {
        const storedDreams = await AsyncStorage.getItem('dreams');
        if (storedDreams) {
          setDreams(JSON.parse(storedDreams));
        }
      } catch (error) {
        console.error(error);
